import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/Home"

function App() {
  document.body.classList = localStorage.getItem("user.theme");
  return (
    <>
      <BrowserRouter>
        <div>
          {/* <Navbar /> */}
          <Routes>

            <Route path="/home" element={<Home />} />

          </Routes>
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;
